import React from "react";
import "./Trending.scss";
import rodeo from "../resources/images/rodeo.jpg";

const Trending = () => {
    return (
        <div className="trending-body-container">
            <div className="trending-title-container">
                <h1>Trending Songs</h1>
            </div>
            <div className="song-container">
                <div className="first">
                    <img className="first-image" src={rodeo} alt="rodeo"></img>
                </div>
                <div className="second">Die Lit</div>
            </div>
        </div>
    );
};

export default Trending;
